/*
-- Query: SELECT name, Quality, ItemLevel, InventoryType, entry FROM classic.item_template
where RequiredLevel > 59 && Quality > 1 && InventoryType > 0
-- Date: 2019-07-20 15:13
*/
DROP TABLE IF EXISTS items_gp;
CREATE TABLE `items_gp` (
`name` TEXT,
`Quality` INT NOT NULL,
`ItemLevel` INT NOT NULL,
`InventoryType` INT NOT NULL,
`entry` INT NOT NULL,
`gp` INT DEFAULT 0,
PRIMARY KEY ( `entry` )
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

